import './App.css';
import EngtoThai from './Containers/Engtothai';
import { BrowserRouter, Route, Routes} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<EngtoThai />} />
        <Route path="/meeting-setup" element={<MeetingSetup />} />
        <Route path="/meeting-status" element={<MeetingStatus />} />
        <Route path="/chat" element={<ChatGPT />} />
        <Route path="/systemprocess" element={<Systemprocess />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
